script: |
  super -f text -I q4690.spq | sort > q4690.out

inputs:
  - name: q4690.spq
    data: |
      SELECT DISTINCT col1 FROM tab2 (FORMAT parquet) WHERE + 76 / + col1 / 47 - col1 - + 0 - + + 6 + col0 * + col2 NOT BETWEEN NULL AND + 67;
  - name: tab2

outputs:
  - name: q4690.out
    data: |
      51
      67
      77
